import React, { Component } from 'react';
import './App.css';




class Artist extends Component {
  constructor(props) {
    super(props);
    this.state = {
    Artist1:[],
    };

  }
   
  componentDidMount() {
    const endpoint = "http://localhost:8000/artist";
    fetch(endpoint)
    .then (responce => responce.json())
    .then(result=> this.setState({Artist1:result}));
  }

  

  render() {
    const {Artist1} = this.state;
console.log (Artist1)
if(Artist1.lenght === 0){
  return(<p>Nothing To Show</p>)
}else{
    return (
      <div className="column">
        <table className="table">
            <thead><tr>{Object.entries(Artist1).map((el,i) => <th key={i}>{el[0]}</th>)}
          </tr>
          </thead>
        <tbody>
          {Artist1.map(el =>(
            <tr key={el.id}>
              {Object.entries(el).map((el,i) => <td key={i}>{el[1]}</td>)}
            </tr>
          ))}
        </tbody>
        </table>
      </div>

    );
          }
  }
}
